os devolvidos poder&aacute; ser feito de duas maneiras, dependendo da forma de pagamento efetuada no momento da compra. Nas compras feitas com cart&atilde;o de cr&eacute;dito O estorno do valor pago poder&aacute; ocorrer em at&eacute; duas faturas subseq&uuml;entes, dependendo da data do vencimento de seu cart&atilde;o. Nas compras efetuadas com boleto banc&aacute;rio ou cart&atilde;o de d&eacute;bito O dep&oacute;sito equivalente ao valor da mercadoria devolvida ser&aacute; feito na conta corrente do cliente em at&eacute; 15 dias &uacute;teis a partir da aprova&ccedil;&atilde;o da devolu&ccedil;&atilde;o pelo nosso setor de atendimento ao cliente. Para isto, ao fazer contato, informe seus dados banc&aacute;rios - banco, conta corrente e CPF. ATEN&Ccedil;&Atilde;O: A restitui&ccedil;&atilde;o dos valores pagos s&oacute; ser&aacute; realizada ap&oacute;s o recebimento e an&aacute;lise das condi&ccedil;&otilde;es do(s) produto(s) por nossa equipe de controle de qualidade. (O produto n&atilde;o poder&aacute; trazer qualquer ind&iacute;cio de uso). O produto que n&atilde;o atender as condi&ccedil;&otilde;es exigidas acima, n&atilde;o ser&aacute; aceito como devolu&ccedil;&atilde;o, e, automaticamente ser&aacute; remetido de volta ao endere&ccedil;o de origem. Nessas condi&ccedil;&otilde;es, a CONNECTPARTS, se reservar&aacute; no direito de fazer nova cobran&ccedil;a de frete. NOTA: Antes de enviar o produto para troca, entre em contato com nosso atendimento, caso contr&aacute;rio os pedidos n&atilde;o ser&atilde;o aceitos. PRODUTO SEM DEFEITO Produto Novo Para produto novo voc&ecirc; ter&aacute; at&eacute; 07 dias para substitui&ccedil;&atilde;o. Desde que este seja apresentado nas mesmas condi&ccedil;&otilde;es em que foi recebido /comprado e sem ind&iacute;cios de uso. ''Lembre-se que para efetuarmos a troca, o produto dever&aacute; estar na embalagem original, acompanhado de todos os acess&oacute;rios e manuais em perfeitas condi&ccedil;&otilde;es e sem ind&iacute;ci