rer&aacute; nas seguintes situa&ccedil;&otilde;es: No caso de impossibilidade de entrega da mercadoria adquirida, por motivo de inexist&ecirc;ncia do endere&ccedil;o de entrega como indicado pelo comprador, ou a sua n&atilde;o acessibilidade, o produto retornar&aacute; para o nosso Centro de Distribui&ccedil;&atilde;o, gerando devolu&ccedil;&atilde;o por parte da CONNECTPARTS dos valores correspondentes aos pre&ccedil;os dos produtos, excluindo-se os custos com frete. Caso ocorra a falta da mercadoria adquirida pelo comprador na loja virtual da CONNECTPARTS, em fun&ccedil;&atilde;o de ocorr&ecirc;ncia de vendas do produto, haver&aacute; a devolu&ccedil;&atilde;o dos valores pagos ao comprador, atrav&eacute;s do mesmo meio de pagamento utilizado na compra. Nessas situa&ccedil;&otilde;es, o comprador ser&aacute; comunicado do ocorrido.|Antena Amplificadora Automotiva Interna Look Out A&nbsp;Antena Amplificadora&nbsp;tem excelente&nbsp;recep&ccedil;&atilde;o dos sinais AM e FMpossibilitando que voc&ecirc; escute sua r&aacute;dio preferida sem interfer&ecirc;ncia ou interrup&ccedil;&otilde;es de sinais provocados por falta de sinal.A&nbsp;Antena Amplificadora Interna&nbsp;tem aplica&ccedil;&atilde;o&nbsp;universal&nbsp;podendo ser instalada em qualquer carro, sua fixa&ccedil;&atilde;o &eacute; feito por meio de fita adesiva dupla face no para-brisa, o que elimina qualquer tipo de furo preservando o seu carro, tem design discreto e pr&aacute;tica.Compatibilidade:&bull; Universal|24|1');
