(5, 4, 72, 0, 2, '<p><strong>SUM&Aacute;RIO DO CONTRATO</strong></p>\r\n<p><strong>DESIST&Ecirc;NCIA DA COMPRA</strong></p>\r\n<p>Se voc&ecirc; efetuou a compra atrav&eacute;s do site CONNECTPARTS.COM.BR, recebeu o produto em perfeitas condi&ccedil;&otilde;es e ainda assim n&atilde;o se sentiu feliz, voc&ecirc; poder&aacute; solicitar o cancelamento do mesmo por meio de nossa Central de relacionamento: (14) 3311-8100 ou pelo e-mail vendas@Connectparts.com.br Sua satisfa&ccedil;&atilde;o &eacute; 100% garantida! Mas fique atento para as regras abaixo:</p>\r\n<p><strong>Prazo para desist&ecirc;ncia de compra</strong></p>\r\n<p>Conforme ditam as normas do CDC (C&oacute;digo de Defesa do Consumidor), o cliente que realiza compras atrav&eacute;s de lojas virtuais goza de at&eacute; 07 (sete) dias ap&oacute;s o recebimento do produto, para registrar a desist&ecirc;ncia da compra.</p>\r\n<p>Conforme o artigo 49, o consumidor pode desistir do contrato no prazo de sete dias &agrave; contar de sua assinatura, ou do ato de recebimento do produto ou servi&ccedil;o, sempre que a contrata&ccedil;&atilde;o de fornecimento de produtos e servi&ccedil;os ocorrer fora do estabelecimento comercial, especialmente por telefone ou em domic&iacute;lio.</p>\r\n<p>Par&aacute;grafo &uacute;nico - Se o consumidor exercitar o direito de arrependimento previsto neste artigo, os valores eventualmente pagos, a qualquer t&iacute;tulo, durante o prazo de reflex&atilde;o, ser&atilde;o devolvidos, de imediato, monetariamente atualizados.</p>\r\n<p><strong>Devolu&ccedil;&atilde;o da Mercadoria</strong></p>\r\n<p>- A mercadoria dever&aacute; ser devolvida atrav&eacute;s dos correios ou transportadora, com porte pago pelo cliente, para o endere&ccedil;o da empresa;<br />- O produto deve ser devolvido em sua embalagem original, acompanhado de todos os acess&oacute;rios e manuais, em perfeitas condi&ccedil;&otilde;es;<br />- O produto n&atilde;o poder&aacute; apresentar qualquer ind&iacute;cio de uso, caso contr&aacute;rio n&atilde;o ser&aacute; aceito.</p>\r\n<p>O reembolso de valores referentes a produtos devolvidos poder&aacute; ser feito de duas maneiras, dependendo da forma de pagamento efetuada no momento da compra.</p>\r\n<p><strong>Nas compras feitas com cart&atilde;o de cr&eacute;dito</strong></p>\r\n<p>O estorno do valor pago poder&aacute; ocorrer em at&eacute; duas faturas subseq&uuml;entes, dependendo da data do vencimento de seu cart&atilde;o.</p>\r\n<p><strong>Nas compras efetuadas com boleto banc&aacute;rio ou cart&atilde;o de d&eacute;bito</strong></p>\r\n<p>O dep&oacute;sito equivalente ao valor da mercadoria devolvida ser&aacute; feito na conta corrente do cliente em at&eacute; 15 dias &uacute;teis a partir da aprova&ccedil;&atilde;o da devolu&ccedil;&atilde;o pelo nosso setor de atendimento ao cliente.</p>\r\n<p>Para isto, ao fazer contato, informe seus dados banc&aacute;rios - banco, conta corrente e CPF.</p>\r\n<p>ATEN&Ccedil;&Atilde;O: A restitui&ccedil;&atilde;o dos valores pagos s&oacute; ser&aacute; realizada ap&oacute;s o recebimento e an&aacute;lise das condi&ccedil;&otilde;es do(s) produto(s) por nossa equipe de controle de qualidade. (O produto n&atilde;o poder&aacute; trazer qualquer ind&iacute;cio de uso).</p>\r\n<p>O produto que n&atilde;o atender as condi&ccedil;&otilde;es exigidas acima, n&atilde;o ser&aacute; aceito como devolu&ccedil;&atilde;o, e, automaticamente ser&aacute; remetido de volta ao endere&ccedil;o de origem. Nessas condi&ccedil;&otilde;es, a CONNECTPARTS, se reservar&aacute; no direito de fazer nova cobran&ccedil;a de frete.</p>\r\n<p>NOTA: Antes de enviar o produto para troca, entre em contato com nosso atendimento, caso contr&aacute;rio os pedidos n&atilde;o ser&atilde;o aceitos.</p>\r\n<p><strong>PRODUTO SEM DEFEITO</strong></p>\r\n<p><strong>Produto Novo</strong></p>\r\n<p>Para produto novo voc&ecirc; ter&aacute; at&eacute; 07 dias para substitui&ccedil;&atilde;o. Desde que este seja apresentado nas mesmas condi&ccedil;&otilde;es em que foi recebido /comprado e sem ind&iacute;cios de uso.</p>\r\n<p>''Lembre-se que para efetuarmos a troca, o produto dever&aacute; estar na embalagem original, acompanhado de todos os acess&oacute;rios e manuais em perfeitas condi&ccedil;&otilde;es e sem ind&iacute;cios de uso.''</p>\r\n<p>Se voc&ecirc; escolheu o produto em nossa loja virtual, mas ao receb&ecirc;-lo n&atilde;o ficou satisfeito e deseja fazer a substitui&ccedil;&atilde;o por outro item, observe as regras:</p>\r\n<p><strong>Devolu&ccedil;&atilde;o da Mercadoria</strong></p>\r\n<p>- O produto n&atilde;o poder&aacute; apresentar qualquer ind&iacute;cio de uso;<br />- O produto dever&aacute; ser devolvido em sua embalagem original, acompanhado de todos os acess&oacute;rios e manuais;<br />- A mercadoria dever&aacute; ser devolvida atrav&eacute;s do servi&ccedil;o de coleta dos correios ou transportadora, e remetido ao endere&ccedil;o constante do remetente, CONNECTPARTS IMPORTS, ou sendo previamente solicitada atrav&eacute;s de nossa Central de Relacionamento, pelo telefone: (14) 3311-8100 ou pelo e-mail vendas@Connectparts.com.br;<br />-O cliente dever&aacute; enviar por escrito, um breve relato sobre o suposto defeito a qual se refere a reclama&ccedil;&atilde;o, esclarecendo sobre o problema ocorrido, etc.</p>\r\n<p><strong>An&aacute;lise de defeitos dos produtos</strong></p>\r\n<p>Ser&aacute; feito uma avalia&ccedil;&atilde;o do prov&aacute;vel defeito pelo setor de qualidade da CONNECTPARTS, e caso necess&aacute;rio ser&aacute; submetido a an&aacute;lise t&eacute;cnica do fabricante onde receberemos o laudo final atestando a troca.</p>\r\n<p>Prazo m&eacute;dio de conclus&atilde;o: 25 dias &uacute;teis ap&oacute;s o recebimento do produto.</p>\r\n<p><strong>Laudo Favor&aacute;vel &agrave; troca</strong></p>\r\n<p>Uma vez o laudo de troca tenha parecer favor&aacute;vel, o cliente receber&aacute; no endere&ccedil;o de origem, sem custos adicionais, a substitui&ccedil;&atilde;o pelo mesmo produto.<br />Na aus&ecirc;ncia do produto no estoque, o cliente ser&aacute; comunicado e poder&aacute; escolher um outro produto para troca, entre as op&ccedil;&otilde;es existentes no site, respeitando o valor limite do cr&eacute;dito.</p>\r\n<p>Se houver diferen&ccedil;a de pre&ccedil;o entre o produto escolhido e o produto reclamado, dever&aacute; ser providenciado o pagamento da diferen&ccedil;a.</p>\r\n<p>ATEN&Ccedil;&Atilde;O: A restitui&ccedil;&atilde;o dos valores pagos s&oacute; ser&aacute; realizada ap&oacute;s o recebimento e an&aacute;lise das condi&ccedil;&otilde;es do(s) produto(s) por nossa equipe de controle de qualidade. (O produto n&atilde;o poder&aacute; trazer qualquer ind&iacute;cio de uso).</p>\r\n<p>O produto que n&atilde;o atender as condi&ccedil;&otilde;es exigidas acima, n&atilde;o ser&aacute; aceito como devolu&ccedil;&atilde;o, e, automaticamente ser&aacute; remetido de volta ao endere&ccedil;o de origem. Nessas condi&ccedil;&otilde;es, a CONNECTPARTS, se reservar&aacute; no direito de fazer nova cobran&ccedil;a de frete</p>\r\n<p>NOTA: Antes de enviar o produto para troca, entre em contato com nosso atendimento, caso contr&aacute;rio os pedidos n&atilde;o ser&atilde;o aceitos.</p>\r\n<p><strong>Laudo Contr&aacute;rio a troca</strong></p>\r\n<p>Caso o produto tenha recebido o laudo contr&aacute;rio a troca, ser&aacute; devolvido ao cliente com a carta / laudo de reprova&ccedil;&atilde;o, sem direito de substitui&ccedil;&atilde;o, tamb&eacute;m ser&aacute; cobrado o custo do envio pelo meio de transporte que o cliente desejar.</p>\r\n<p><strong>Itens de reprova&ccedil;&atilde;o</strong></p>\r\n<p>-Inexist&ecirc;ncia de defeito (n&atilde;o constata&ccedil;&atilde;o do dano apontado pelo cliente);<br />-Constata&ccedil;&atilde;o ou ind&iacute;cio de uso inadequado do produto;<br />-Constata&ccedil;&atilde;o ou ind&iacute;cio de dano acidental;<br />-Desgaste natural em decorr&ecirc;ncia do uso.</p>\r\n<p><strong>Cancelamento Autom&aacute;tico de compra por parte da CONNECTPARTS</strong></p>\r\n<p>A CONNECTPARTS, reserva o direito de cancelar o pedido e libera&ccedil;&atilde;o nas situa&ccedil;&otilde;es apresentadas abaixo:</p>\r\n<p>- Impossibilidade de execu&ccedil;&atilde;o do d&eacute;bito correspondente &agrave; compra no cart&atilde;o de cr&eacute;dito;<br />- Inconsist&ecirc;ncia de dados cadastrais preenchidos no pedido;<br />- N&atilde;o pagamento do boleto banc&aacute;rio ou dep&oacute;sito em conta corrente;<br />- Aus&ecirc;ncia do produto no estoque.</p>\r\n<p>Para estes casos a restitui&ccedil;&atilde;o de valores por iniciativa da CONNECTPARTS ocorrer&aacute; nas seguintes situa&ccedil;&otilde;es:</p>\r\n<p>No caso de impossibilidade de entrega da mercadoria adquirida, por motivo de inexist&ecirc;ncia do endere&ccedil;o de entrega como indicado pelo comprador, ou a sua n&atilde;o acessibilidade, o produto retornar&aacute; para o nosso Centro de Distribui&ccedil;&atilde;o, gerando devolu&ccedil;&atilde;o por parte da CONNECTPARTS dos valores correspondentes aos pre&ccedil;os dos produtos, excluindo-se os custos com frete.</p>\r\n<p>Caso ocorra a falta da mercadoria adquirida pelo comprador na loja virtual da CONNECTPARTS, em fun&ccedil;&atilde;o de ocorr&ecirc;ncia de vendas do produto, haver&aacute; a devolu&ccedil;&atilde;o dos valores pagos ao comprador, atrav&eacute;s do mesmo meio de pagamento utilizado na compra. Nessas situa&ccedil;&otilde;es, o comprador ser&aacute; comunicado do ocorrido.</p>'),
(6, 4, 73, 0, 2, '<h2>Antena Amplificadora Automotiva Interna Look Out</h2>\r\n<p><br /><span>A&nbsp;</span><a href="http://www.connectparts.com.br/antena-e-receptor-tv-digital?PS=12" target="_blank"><strong>Antena Amplificadora</strong></a><span>&nbsp;tem excelente&nbsp;</span><strong>recep&ccedil;&atilde;o dos sinais AM e FM</strong><span>possibilitando que voc&ecirc; escute sua r&aacute;dio preferida sem interfer&ecirc;ncia ou interrup&ccedil;&otilde;es de sinais provocados por falta de sinal.</span><br /><br /><span>A&nbsp;</span><strong>Antena Amplificadora Interna</strong><span>&nbsp;tem aplica&ccedil;&atilde;o&nbsp;</span><strong>universal</strong><span>&nbsp;podendo ser instalada em qualquer carro, sua fixa&ccedil;&atilde;o &eacute; feito por meio de fita adesiva dupla face no para-brisa, o que elimina qualquer tipo de furo preservando o seu carro, tem design discreto e pr&aacute;tica.</span><br /><br /><strong>Compatibilidade:</strong><br /><span>&bull; Universal</span></p>'),
