(1, 'Footer Links', 'footer_links', '\n<ul>\n    <li><a href="{{store direct_url="about-magento-demo-store"}}">About Us</a></li>\n    <li><a href="{{store direct_url="customer-service"}}">Customer Service</a></li>\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy</a></li>\r\n</ul>', '2014-07-05 00:48:28', '2014-07-05 00:48:29', 1),
(2, 'Footer Links Company', 'footer_links_company', '\n<div class="links">\n    <div class="block-title">\n        <strong><span>Company</span></strong>\n    </div>\n    <ul>\n        <li><a href="{{store url=""}}about-magento-demo-store/">About Us</a></li>\n        <li><a href="{{store url=""}}contacts/">Contact Us</a></li>\n        <li><a href="{{store url=""}}customer-service/">Customer Service</a></li>\n        <li><a href="{{store url=""}}privacy-policy-cookie-restriction-mode/">Privacy Policy</a></li>\n    </ul>\n</div>', '2014-07-05 00:48:29', '2014-07-05 00:48:29', 1),
(3, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2014-07-05 00:48:29', '2014-07-05 00:48:29', 1),
(4, 'Home top banner', 'home_top_banner', '<img src="{{media url="wysiwyg/banner/topo-bandeira.jpg"}}" alt="" />', '2014-07-06 03:50:37', '2014-07-06 03:50:37', 1),
(5, 'Institucional', 'institucional', '<div id="empresa" class="footer-cols">\r\n<div class="title">Institucional</div>\r\n<ul>\r\n<li><a title="Quem somos" href="/centraldeatendimento#quemsomos">Quem somos</a></li>\r\n<li><a title="Como Comprar" href="/centraldeatendimento#comocomprar">Como Comprar</a></li>\r\n<li><a title="Pagamento e envio" href="/centraldeatendimento#pagamento-e-envio">Pagamento e envio</a></li>\r\n<li><a title="Garantia" href="/centraldeatendimento#garantia">Garantia</a></li>\r\n<li><a title="Seguran&ccedil;a" href="/centraldeatendimento#central-seguranca">Seguran&ccedil;a</a></li>\r\n<li><a title="Fale Conosco" href="/site/faleconosco.aspx">Fale Conosco</a></li>\r\n<li><a title="Mapa do site" href="/mapa-do-site/mapa">Mapa do site</a></li>\r\n</ul>\r\n</div>', '2014-07-08 03:31:28', '2014-07-08 19:17:27', 1),
(6, 'reconhecimento', 'reconhecimento', '<div id="reconhecimento" class="footer-cols">\r\n<div class="title">reconhecimento e seguranca</div>\r\n<img src="{{media url="wysiwyg/img_6458.png"}}" alt="" /> <img src="{{media url="wysiwyg/empresa.jpg"}}" alt="" /> <img src="{{media url="wysiwyg/rapidssl.gif"}}" alt="" /></div>', '2014-07-08 03:37:24', '2014-07-08 19:25:22', 1),
(7, 'format de pagamento', 'pagamento', '<div class="footer-cols" id="footer_social">\r\n<div class="title">Format De Pagemento</div>\r\n<img src="{{media url="wysiwyg/footer-payment.jpg"}}" alt="" /></div>', '2014-07-08 19:10:50', '2014-07-08 19:16:43', 1),
(8, 'footer social', 'footer_social', '<div id="footer_social" class="footer-cols">\r\n<div class="title">Fique Conectado</div>\r\n<div>\r\n<ul id="midias-sociais">\r\n<li><a class="footer-fb" title="Connect Parts no Facebook" href="https://www.facebook.com/pages/Connect-Parts/287018914669006">&nbsp;</a></li>\r\n<li><a class="footer-orkut" title="Connect Parts no Orkut" href="http://www.orkut.com.br/Main#Profile?uid=4277049162984335625">&nbsp;</a></li>\r\n<li><a class="footer-youtube" title="Connect Parts no Youtube" href="http://www.youtube.com/user/connectpts">&nbsp;</a></li>\r\n<li><a class="footer-twitter" title="Connect Parts no Twitter" href="http://twitter.com/connectpts">&nbsp;</a></li>\r\n</ul>\r\n<a class="vtex" title="VTEX" href="http://www.vtex.com.br" rel="nofollow">&nbsp;</a> <a class="profite" title="PROFITE" href="http://www.profite.com.br" rel="nofollow">&nbsp;</a></div>\r\n</div>', '2014-07-08 19:14:03', '2014-07-08 19:37:31', 1),
(9, 'Home promo', 'homepromo', '<p><a href="#"><img src="{{media url="wysiwyg/promo-08-07-14.jpg"}}" alt="" class="img-responsive" /></a></p>', '2014-07-08 20:49:25', '2014-07-11 01:29:18', 1),
(10, 'SOBRE A CONNECT PARTS', 'sobreaconnectparts', '<div class="texto-de-apoio"><h1>Sobre a Connect Parts</h1><p>Se você procura acessórios automotivos, a loja Connect Parts foi pensada e planejada para você!\r\n        Aqui você encontra grande variedade de produtos para clientes apaixonados por carros e motos.\r\n        Navegue pelo site e encontre o que você precisa como \r\n        <strong><a href="http://www.connectparts.com.br/som-e-video">som e vídeo</a>\r\n        e <a href="http://www.connectparts.com.br/acessorios">acessórios automotivos</a>,\r\n        <a href="http://www.connectparts.com.br/farois-lanternas-e-iluminacao/farol-de-milha">\r\n        faróis de milha</a> \r\n        e <a href="http://www.connectparts.com.br/farois-lanternas-e-iluminacao/farol-de-xenon">xenon</a>,\r\n        <a href="http://www.connectparts.com.br/alarmes-e-seguranca/alarme-de-carro-e-caminhao/alarme-de-carro">alarme para carro</a>, alarme para moto, travas e vidros elétricos.\r\n        segurança automotiva e muito mais</strong>.\r\n        Outra vantagem de comprar na Connect Parts é que você pode escolher o modelo do seu carro e conferir os diversos produtos relacionados a ele.\r\n        Nossa lista de carros é ampla e você pode escolher entre Gol, Saveiro, Strada, Siena, Palio, Celta, Prisma, etc,\r\n        e conferir também as diversas opções relacionadas às montadoras como Volkswagen, Fiat, Toyota, Nissan, Citroën, Peugeot, Renault e muito mais.\r\n        Somente aqui você encontra o acessório para tunar seu carro ou moto e ainda paga sempre o Menor Preço.\r\n        Não deixe de conferir as novidades em DVD player, sensor de estacionamento, <strong><a href="http://www.connectparts.com.br/som-e-video/som-automotivo/modulos-amplificadores">módulos amplificadores</a></strong>, capotas marítimas, <a href="http://www.connectparts.com.br/gps">navegador GPS</a>, além das principais marcas como Pioneer, Multilaser, Pósitron, Bravox e muito mais você encontra aqui em até 12X S/ Juros com PayPal! \r\n        </p></div>', '2014-07-08 21:25:09', '2014-07-08 21:25:09', 1),
(11, 'hatcar_banner', 'hatcar_banner', '<div class="row" style="margin-right: 0px; margin-left: 0px;">\r\n<div class="col-xs-6 col-sm-6 col-md-6 col-lg-6"><img src="{{media url="wysiwyg/140714-banner-inferior-1-b.jpg"}}" alt="" class="img-responsive" /></div>\r\n<div class="col-xs-6 col-sm-6 col-md-6 col-lg-6"><img src="{{media url="wysiwyg/140714-banner-inferior-2.jpg"}}" alt="" class="img-responsive" /></div>\r\n</div>', '2014-07-14 09:32:51', '2014-07-14 09:44:41', 1);
